define([],function(){return{initialise:function(warning){let calendarselect=document.getElementById('id_customchar1');if(!calendarselect){return;}
const originalvalue=calendarselect.value;if(originalvalue=='0'){return;}
calendarselect.addEventListener('change',function(evt){let errordiv=document.getElementById('id_error_customchar1');if(!errordiv){return;}
if(evt.target.value==originalvalue){errordiv.textContent='';errordiv.style.display='None';}else{errordiv.textContent=warning;errordiv.style.display='block';}});}};});